import { Container, Row, Col, Placeholder } from 'react-bootstrap';
import { Icon } from '@iconify/react';
import Image from 'react-bootstrap/Image';
import halfbyte from "../works/halfbyte.png";
import upcancer from "../works/upcancer.png";
// import likeex from "../works/likeex.png";


export default function Work() {
    return (
        <Container className='myGallery'>
            <Row>
                <h1>Gallery with hover effect</h1>

                <Col>  <div class="media">
                    <div class="layer">
                        <p>+ Paul Gilmore</p>
                    </div>
                    <img src={upcancer} />
                </div></Col>

                <Col>   <div class="media">
                    <div class="layer">
                        <p>+ M. O' Neil</p>
                    </div>
                    <img src="https://images.unsplash.com/photo-1443397646383-16272048780e?dpr=1&auto=format&fit=crop&w=1199&h=899&q=80&cs=tinysrgb&crop=" alt="" />
                </div></Col>

                <Col>   <div class="media">
                    <div class="layer">
                        <p>+ N. Mehta</p>
                    </div>
                    <img src="https://images.unsplash.com/photo-1442965416224-f6a7eca980fa?dpr=1&auto=format&fit=crop&w=1199&h=799&q=80&cs=tinysrgb&crop=" alt="" />
                </div></Col>
            </Row>
        </Container>
    )
}
